export default function Home() {
  return(
    <main>
      <section id="about">
        <h2>About</h2>
        <p>
          This app was written by Andrew Cashner.
        </p>
        <p>
          The front end is in Javascript using the React framework.
          The back end is in Python using the Django framework and a MySQL database.
        </p>
      </section>
    </main>
  );
}
